import './App.css';
import  HeaderComponent  from './components/header/Header.tsx';
import  { ButtonComponent } from './components/buttonComponent/button.tsx'


function App() {
  return (
    <div className="App">
      <HeaderComponent></HeaderComponent>
      <br></br>

      <ButtonComponent 
      size={1}
      type="primary"
      id={'love'}
      className={'hello'}
      variant="contained"
      children="&#x2665;"
     />

<ButtonComponent 
      size={1}
      type="primary"
      id={'love'}
      className={'hello'}
      variant="contained"
      children="Mcdonalds"
     />



    </div>
  );
}

export default App;
